import React from 'react';
import Data from '../data.json'

export default function Servicios() {
    return (
        <div className='servicios'>
            {Data.map(post => {
                return (
                    <>
                        <h4>{post.tittle}</h4>
                        <p>{post.smallContent}</p>
                    </>
                    )
            })}
        </div>
    );
}
